{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/adwoaagyeiwaa/google-data-analytics-capstone-case-study-1?scriptVersionId=104121041\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown","outputs":[],"execution_count":0},{"cell_type":"markdown","id":"d7617807","metadata":{"papermill":{"duration":0.018003,"end_time":"2022-08-24T18:38:46.334021","exception":false,"start_time":"2022-08-24T18:38:46.316018","status":"completed"},"tags":[]},"source":["# Table of Contents\n","* [Introduction](#section-one)\n","     - [Deliverables](#subsection-deliverable)\n","* [Case Study](#section-two)\n","     - [Scenario](#subsection-one)\n","     - [Characters and Teams](#subsection-two)\n","     - [About the Company](#subsection-three)\n","* [Ask](#section-three)\n","     - [Hypothesis](#subsection-four)\n","     - [Business Task](#subsection-five)\n","     - [Objective](#subsection-six)\n","* [Prepare](#section-four)\n","     - [Raw Data](#subsection-seven)\n","* [Process](#section-five)\n","     - [Pre-cleaning in Excel](#subsection-eight)\n","     - [Pre-cleaned Data](#subsection-nine)\n","* [Analyse](#section-six)\n","     - [R Packages](#subsection-ten)\n","     - [Data Importation](#subsection-eleven)\n","     - [Data Aggregation](#subsection-twelve)\n","     - [Wrangling](#subsection-thirteen)\n","     - [Cleaning](#subsection-fourteen)\n","     - [Analysis](#subsection-fifteen)\n","     - [Data Exploration](#subsection-sixteen)\n","     - [Summary Data](#subsection-seventeen)\n","* [Share](#section-seven)\n","     - [Goal](#subsection-eighteen)\n","     - [Number of Rides](#subsection-nineteen)\n","     - [Average Ride Duration](#subsection-twenty)\n","     - [Type of Bikes](#subsection-twenty-one)\n","     - [Key Findings](#subsection-twenty-two)\n","* [Act](#section-eight)\n","     - [Goal](#subsection-twenty-three)\n","     - [Conclusion](#subsection-twenty-four)\n","     - [Recommendations](#subsection-twenty-five)\n","     - [Further Work](#subsection-twenty-six)"]},{"cell_type":"markdown","id":"f895f3a1","metadata":{"papermill":{"duration":0.016056,"end_time":"2022-08-24T18:38:46.366541","exception":false,"start_time":"2022-08-24T18:38:46.350485","status":"completed"},"tags":[]},"source":["<a id=\"section-one\"></a>\n","# Introduction\n","Hi there! This is my first data analysis project as a data analyst. My capstone project is based on the first case study from the Google Data Analytics Certification. In this project, I will follow Google's data analysis process in this particular order:\n","1. ask\n","2. prepare\n","3. process\n","4. analyse\n","5. share\n","6. act\n","\n","<a id=\"subsection-deliverable\"></a>\n","#### Deliverables\n","By the end of the analysis, the following deliverables should be provided:\n","\n","|No.      |Phase                    |Deliverable                                                     |Description\n","|---------|-------------------------|----------------------------------------------------------------|-------------------\n","|1        |Ask                      |[A clear statement of the business task](#subsection-five)      |The question or problem the analysis answers for the business|\n","|2        |Prepare                  |[A description of all data sources used](#section-four)         |Location of the data located, organization, credibility and integrity of data|\n","|3        |Process                  |[Documentation of any cleaning or manipulation of data](#subsection-eight)|Checking the data for errors, tools used, transforming the data and documenting the cleaning process|\n","|4        |Analyse                  |[A summary of analysis done](#section-six)|Aggregating data, organizing, perform calculations and identifying trends and relationships|\n","|5        |Share                    |[Supporting visualizations and key findings](#section-seven)    |The story the data is telling in the data visualizations and communication of key findings with stakeholders|\n","|6        |Act                      |[Top three recommendations based on analysis](#subsection-twenty-five)|Final conclusion of analysis and insights for the business including next steps|\n","       \n","\n"]},{"cell_type":"markdown","id":"13522da0","metadata":{"papermill":{"duration":0.017547,"end_time":"2022-08-24T18:38:46.400011","exception":false,"start_time":"2022-08-24T18:38:46.382464","status":"completed"},"tags":[]},"source":["<a id=\"section-two\"></a>\n","# Case Study\n","\n","<a id=\"subsection-one\"></a>\n","#### Scenario\n","You are a junior data analyst working in the marketing analyst team at Cyclistic, a bike-share company in Chicago. The director of marketing believes the company’s future success depends on maximizing the number of annual memberships. Therefore,\n","your team wants to understand how casual riders and annual members use Cyclistic bikes differently. From these insights, your team will design a new marketing strategy to convert casual riders into annual members. But first, Cyclistic executives must approve your recommendations, so they must be backed up with compelling data insights and professional data visualizations.\n","\n","<a id=\"subsection-two\"></a>\n","#### Characters and Teams\n","* Cyclistic: A bike-share program that features more than 5,800 bicycles and 600 docking stations. Cyclistic sets itself apart by also offering reclining bikes, hand tricycles, and cargo bikes, making bike-share more inclusive to people with disabilities and riders who can’t use a standard two-wheeled bike. The majority of riders opt for traditional bikes; about 8% of riders use the assistive options. Cyclistic users are more likely to ride for leisure, but about 30% use them to commute to work each day.\n","* Lily Moreno: The director of marketing and your manager. Moreno is responsible for the development of campaigns and initiatives to promote the bike-share program. These may include email, social media, and other channels.\n","* Cyclistic marketing analytics team: A team of data analysts who are responsible for collecting, analyzing, and reporting data that helps guide Cyclistic marketing strategy. You joined this team six months ago and have been busy learning about Cyclistic’s mission and business goals — as well as how you, as a junior data analyst, can help Cyclistic achieve them.\n","* Cyclistic executive team: The notoriously detail-oriented executive team will decide whether to approve the recommended marketing program.\n","\n","<a id=\"subsection-three\"></a>\n","#### About the Company\n","In 2016, Cyclistic launched a successful bike-share offering. Since then, the program has grown to a fleet of 5,824 bicycles that are geotracked and locked into a network of 692 stations across Chicago. The bikes can be unlocked from one station and\n","returned to any other station in the system anytime. Until now, Cyclistic’s marketing strategy relied on building general awareness and appealing to broad consumer segments.\n","One approach that helped make these things possible was the flexibility of its pricing plans: single-ride passes, full-day passes, and annual memberships. Customers who purchase single-ride or full-day passes are referred to as casual riders. Customers who purchase annual memberships are Cyclistic members.\n","Cyclistic’s finance analysts have concluded that annual members are much more profitable than casual riders. Although the pricing flexibility helps Cyclistic attract more customers, Moreno believes that maximizing the number of annual members will be key to future growth. Rather than creating a marketing campaign that targets all-new customers, Moreno believes there is a very good chance to convert casual riders into members. She notes that casual riders are already aware of the Cyclistic\n","program and have chosen Cyclistic for their mobility needs.\n","Moreno has set a clear goal: Design marketing strategies aimed at converting casual riders into annual members. In order to do that, however, the marketing analyst team needs to better understand how annual members and casual riders differ, why casual riders would buy a membership, and how digital media could affect their marketing tactics. Moreno and her team are interested in analyzing the Cyclistic historical bike trip data to identify trends."]},{"cell_type":"markdown","id":"10dad6c8","metadata":{"papermill":{"duration":0.016169,"end_time":"2022-08-24T18:38:46.432156","exception":false,"start_time":"2022-08-24T18:38:46.415987","status":"completed"},"tags":[]},"source":["<a id=\"section-three\"></a>\n","# Ask\n","In this phase, I seek to understand the specific problem I am to solve, referred to as the business task, as well as how my insights will benefit the business after considering stakeholders involved. I went on to tease out the hypothesis in order to effectively communicate findings along those lines.\n","\n","<a id=\"subsection-four\"></a>\n","#### Hypothesis\n","Cyclistic’s finance analysts have concluded that annual members are much more profitable than casual riders. The director of marketing believes that increasing the number of yearly memberships is critical to Cyclistic's future success. \n","\n","<a id=\"subsection-five\"></a>\n","#### Business Task\n","Analyze the Cyclistic historical bike trip data to understand how casual riders and annual members use Cyclistic bikes differently by identifying trends in the data.\n","\n","<a id=\"subsection-six\"></a>\n","#### Objective\n","Develop new marketing strategies from findings to convert casual riders into annual members, increasing the company's profitability by a significant margin."]},{"cell_type":"markdown","id":"ad4cdde5","metadata":{"papermill":{"duration":0.015741,"end_time":"2022-08-24T18:38:46.463749","exception":false,"start_time":"2022-08-24T18:38:46.448008","status":"completed"},"tags":[]},"source":["<a id=\"section-four\"></a>\n","# Prepare\n","The raw data for this project was obtained using the <a id=\"subsection-seven\"></a>[link](https://divvy-tripdata.s3.amazonaws.com/index.html) to the data as provided by Google under this [license](https://www.divvybikes.com/data-license-agreement).\n","\n","The data is open to the public. All data is organized in .csv file format, with some metadata in .txt files attached. The data is delivered in batches of months, each named in a \"year-month\" style. Each monthly csv file contains data organized into about thirteen columns, containing information about each ride and trip per day.\n","\n","The data is unbiased and credible because it is licensed, original, comprehensive, current, and cited. Data privacy is also ensured because there are no issues with personally identifiable information of riders connecting the data to specific riders.\n","\n","All datasets to be used were examined to ensure that the column headers in each file were consistent. In addition, each dataset was checked for completeness, accuracy, and format consistency. There were no issues with the data in terms of accuracy or consistency, but there was little information provided on the bike stations for the datasets I was working with. Regardless, the data can be said to have integrity.\n","\n","For the purpose of this analysis, current data from the previous twelve months was used: May 2021 to April 2022. For each monthly dataset, there is data under thirteen column headers. These datasets contain data mainly on trip data."]},{"cell_type":"markdown","id":"e01582ad","metadata":{"papermill":{"duration":0.015786,"end_time":"2022-08-24T18:38:46.49517","exception":false,"start_time":"2022-08-24T18:38:46.479384","status":"completed"},"tags":[]},"source":["<a id=\"section-five\"></a>\n","# Process\n","<a id=\"subsection-eight\"></a>\n","#### Pre-cleaning in Excel\n","I chose **Excel** for my data cleaning because each file had fewer than a million rows and was an easy first tool to use. I verified the integrity of my data by inspecting all datasets to ensure that the column headers in each file were the same and consistent. In addition, each monthly dataset's data was checked for completeness, accuracy, and format consistency. The following steps were taken to process the data:\n","\n","**1. Deleting incomplete data**\n","\n","The bike data had a lot of incomplete data on the bike stations such as the start_station_name, start_station_id, end_station_name and end_station_id. Over 500,000 missing bike station data were found using the `COUNTBLANK` function. Thus, all columns of bike station data were deleted. Furthermore, I discovered that data on the latitude and longitude of the stations will be irrelevant for my analysis due to the scarcity of station data. These, too, were removed. In total, nine out of thirteen data columns were relevant for analysis.\n","\n","\n","**2. Cleaning column headers**\n","\n","All column headers were cleaned by using the `TRIM` function to ensure that there were no extra spaces and that headers were of a consistent format and naming to make merging easy and smooth.\n","\n","\n","**3. Finding the length of each ride**\n","\n","Following the goal of the business task, it was necessary to calculate the length of each ride in order to make some observations. For each dataset, a new column called \"ride_length\" was added. The following formula was used to calculate this:<br>\n","`ride_length = ended_at – started_at (in HH:MM:SS format)`\n","\n","**4. Finding the day of the week each ride started**\n","\n","A new column named “day_of_week” was added to each dataset. The goal was to figure out what day of the week each ride began on in order to find useful trends or patterns in the data. The formula below was used:<br>\n","`day_of_week = WEEKDAY(started_at)`\n","\n","**5. Checking for duplicates**\n","\n","All datasets were checked for duplicates. There were no duplicates found.\n","\n","**6. Deleting bad data**\n","\n","Negative ride length values and blank cells are referred to as bad data in this context. A filter was applied to each column header. Bad data was then filtered out, observed, and removed. Approximately 100 rows of incorrect data were identified and deleted.\n","\n","**7. Validating the data**\n","\n","Before moving on to the next phase, the data was double-checked and cross-examined to ensure that the calculations were correct and that all errors and blank data were removed. Again, filtering was used for the validation.\n","\n","The pre-cleaned data can be found <a id=\"subsection-nine\"></a>[here](../input/bike-data)."]},{"cell_type":"markdown","id":"d09c3fce","metadata":{"papermill":{"duration":0.015989,"end_time":"2022-08-24T18:38:46.526786","exception":false,"start_time":"2022-08-24T18:38:46.510797","status":"completed"},"tags":[]},"source":["<a id=\"section-six\"></a>\n","# Analyse\n","\n","I used the **R** tool for my analysis, because the data when merged will be too large for Excel to handle. The purpose of this analyse step is to merge the cleaned data into a single data frame, and then conduct analysis to help answer the business task. The following steps were taken to achieve this:\n","\n","<a id=\"subsection-ten\"></a>\n","#### Setting up my environment\n","Loading the required packages: `tidyverse` for data import and wrangling, `lubridate` for date functions, `ggplot2` for visualisation and `ggpubr` for plotting scatterplots."]},{"cell_type":"code","execution_count":1,"id":"e7268125","metadata":{"execution":{"iopub.execute_input":"2022-08-24T18:38:46.562352Z","iopub.status.busy":"2022-08-24T18:38:46.560358Z","iopub.status.idle":"2022-08-24T18:48:26.821258Z","shell.execute_reply":"2022-08-24T18:48:26.818798Z"},"papermill":{"duration":580.282477,"end_time":"2022-08-24T18:48:26.824935","exception":false,"start_time":"2022-08-24T18:38:46.542458","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"strea