","quantreg    (5.93    -> 5.94  ) [CRAN]\n","pbkrtest    (NA      -> 0.5.1 ) [CRAN]\n","car         (NA      -> 3.1-0 ) [CRAN]\n","rstatix     (NA      -> 0.7.0 ) [CRAN]\n"]},{"name":"stderr","output_type":"stream","text":["Installing 22 packages: viridisLite, farver, processx, callr, stringi, scales, xfun, evaluate, pillar, tibble, stringr, rlang, generics, knitr, broom, Rcpp, nloptr, lme4, quantreg, pbkrtest, car, rstatix\n","\n","Installing packages into ‘/usr/local/lib/R/site-library’\n","(as ‘lib’ is unspecified)\n","\n","Warning message in i.p(...):\n","“installation of package ‘rlang’ had non-zero exit status”\n","Warning message in i.p(...):\n","“installation of package ‘generics’ had non-zero exit status”\n","Warning message in i.p(...):\n","“installation of package ‘Rcpp’ had non-zero exit status”\n","Warning message in i.p(...):\n","“installation of package ‘pillar’ had non-zero exit status”\n","Warning message in i.p(...):\n","“installation of package ‘tibble’ had non-zero exit status”\n"]},{"name":"stdout","output_type":"stream","text":["\u001b[32m✔\u001b[39m  \u001b[90mchecking for file ‘/tmp/RtmpP5CTdi/remotese7a7df2a3/kassambara-ggpubr-ac5a01f/DESCRIPTION’\u001b[39m\u001b[36m\u001b[39m\n","\u001b[90m─\u001b[39m\u001b[90m  \u001b[39m\u001b[90mpreparing ‘ggpubr’:\u001b[39m\u001b[36m\u001b[39m\n","\u001b[32m✔\u001b[39m  \u001b[90mchecking DESCRIPTION meta-information\u001b[39m\u001b[36m\u001b[39m\n","\u001b[90m─\u001b[39m\u001b[90m  \u001b[39m\u001b[90mchecking for LF line-endings in source and make files and shell scripts\u001b[39m\u001b[36m\u001b[39m\n","\u001b[90m─\u001b[39m\u001b[90m  \u001b[39m\u001b[90mchecking for empty or unneeded directories\u001b[39m\u001b[36m\u001b[39m\n","\u001b[90m─\u001b[39m\u001b[90m  \u001b[39m\u001b[90mbuilding ‘ggpubr_0.4.0.999.tar.gz’\u001b[39m\u001b[36m\u001b[39m\n","   \n","\r"]},{"name":"stderr","output_type":"stream","text":["Installing package into ‘/usr/local/lib/R/site-library’\n","(as ‘lib’ is unspecified)\n"