element_text(angle = 45)) +\n","  labs(title = 'Monthly Total Number of Rides per User Type', caption = 'Graph 3', x = 'Month', y = 'Total Rides', colour = 'User Type')\n"," "]},{"cell_type":"markdown","id":"2c436074","metadata":{"papermill":{"duration":0.026292,"end_time":"2022-08-24T18:50:25.020998","exception":false,"start_time":"2022-08-24T18:50:24.994706","status":"completed"},"tags":[]},"source":["We group months into seasons to find peak seasons based on the following distribution:\n","* Winter : December, January, February\n","* Spring : March, April, May\n","* Summer : June, July, August\n","* Autumn : September, October, November\n","\n","Although members and casuals have similar month-to-month ride trends, members use bikes more than casuals on a monthly basis. **The only time casuals use bikes slightly more than members is during the Summer season.**\n","\n","**The majority of rides, approximately 41% of all rides, take place during Summer.** About 30% of rides take place in Autumn, and 21% in Spring. The number of rides is at its lowest during Winter, at only 8%.\n","\n","Graph 3 shows that **weather temperatures and the number of rides recorded are highly correlated.** The number of rides increases as the temperature rises; as the temperature falls, the number of rides decreases."]},{"cell_type":"code","execution_count":37,"id":"e32113af","metadata":{"execution":{"iopub.execute_input":"2022-08-24T18:50:25.076499Z","iopub.status.busy":"2022-08-24T18:50:25.074935Z","iopub.status.idle":"2022-08-24T18:50:25.451005Z","shell.execute_reply":"2022-08-24T18:50:25.449155Z"},"papermill":{"duration":0.406176,"end_time":"2022-08-24T18:50:25.453449","exception":false,"start_time":"2022-08-24T18:50:25.047273","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["\u001b[1m\u001b[22m`summarise()` has grouped output by 'day_of_week'. You can override using the\n","`.groups` argument.\n"]},{"data":{"image/png":"iVBORw0KGgoAAAANSUhEU