start_time":"2022-08-24T18:50:25.480626","status":"completed"},"tags":[]},"source":["So, how does the total number of rides for members and casual rides vary on a daily basis?\n","\n","Members and casuals use bikes differently on a daily basis because they have **opposite daily trends.**\n","\n","Again, we group days into Weekends and Weekdays to make some observations:\n","* Weekend: Saturday, Sunday\n","* Weekday: Monday, Tuesday, Wednesday, Thursday, Friday\n","\n","Overall, **Weekdays are peak days**. Weekday rides account for 68% of all rides, while weekend rides account for only 32%.\n","\n","Casuals ride bikes more frequently from Friday to the Weekend, and fairly consistently on other Weekdays; annuals ride bikes almost every day, with a slight dip on Sundays.\n","\n","**Casuals make up the majority of Weekend rides, while members make up the vast majority of Weekday rides. Ride volumes are higher for casuals than for members only on Weekends.**<br><br><br>\n","\n","*Note: Extreme caution should be exercised when analysing Graph 4 because the y-axis does not begin at 0. The emphasis for this graph is on revealing trends rather than on values.*\n"]},{"cell_type":"code","execution_count":38,"id":"0399a6a4","metadata":{"execution":{"iopub.execute_input":"2022-08-24T18:50:25.564822Z","iopub.status.busy":"2022-08-24T18:50:25.563183Z","iopub.status.idle":"2022-08-24T18:50:25.91455Z","shell.execute_reply":"2022-08-24T18:50:25.912681Z"},"papermill":{"duration":0.383154,"end_time":"2022-08-24T18:50:25.917559","exception":false,"start_time":"2022-08-24T18:50:25.534405","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["\u001b[1m\u001b[22m`summarise()` has grouped output by 'hour_of_day'. You can override using the\n","`.groups` argument.\n"]},{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdd3wc1b028OdM3aLu3ossuVdcAGN6DYEQAunU3JACSUjgBhJSSUI6kEaSm37f\nFHJvCgmXDqGEZhtXX