t_type":"display_data"}],"source":["summary %>%\n","  group_by(hour_of_day, user_type) %>%\n","  summarise(total_rides = sum(number_of_rides)) %>%\n","  ggplot(aes(x = hour_of_day, y = total_rides, colour = user_type, group = user_type)) +\n","  geom_line() +\n","  geom_point() +\n","  scale_y_continuous(labels = scales::comma) +\n","  labs(title = 'Hourly Total Number of Rides per User Type', caption = 'Graph 5', x = 'Hour of Day', y = 'Total Rides', colour = 'User Type')"]},{"cell_type":"markdown","id":"0be4d6c0","metadata":{"papermill":{"duration":0.028299,"end_time":"2022-08-24T18:50:25.97502","exception":false,"start_time":"2022-08-24T18:50:25.946721","status":"completed"},"tags":[]},"source":["Both members and casuals exhibit similar trends in hourly rides.\n","\n","Lets breakdown hours into the following categories for better observations:\n","* Morning : 05:00hrs - 12:00hrs\n","* Afternoon : 12:00hrs - 17:00hrs\n","* Evening : 17:00hrs - 21:00hrs\n","* Night : 21:00hrs - 04:00hrs\n","\n","During the active hours of the day, from morning to evening, members use bikes more than casuals. Both types of users use bikes almost equally in the afternoons. **The most rides are recorded in the late afternoons and early evenings, with 17:00hrs being the peak.** Nighttime has the lowest volume of rides.\n","\n","Members have two major peak hours:\n","1. Early morning, from 07:00hrs to 08:00hrs.\n","2. Late afternoon to early evening, from 16:00hrs to 18:00hrs.\n","\n","Casuals have just one peak hour - 17:00hrs. They rely more on the Cyclistic bikes from late afternoon to early evening.\n"]},{"cell_type":"code","execution_count":39,"id":"54ed4d82","metadata":{"execution":{"iopub.execute_input":"2022-08-24T18:50:26.035308Z","iopub.status.busy":"2022-08-24T18:50:26.033687Z","iopub.status.idle":"2022-08-24T18:50:26.047844Z","shell.execute_reply":"2022-08-24T18:50:26.046048Z"},"papermill":{"duration":0.046939,"end_time":"2022-08-24T18:50:26.050176","exception":false,"start_