K1ogie4i1kPvgw2b6leacu3bt37969u/yGtmqkh7fI9oPVeLNfbOiQ\npV+Vsj5d+41Yv3N71TBS5WdGxFBqqqjIQ/gvmifyaAsAw1tU3hF+JsZDdzPlXxSFHlyY2CGE\nEEK1wgj9t49sfHH5wD0Z5VW3F1/aNv5ErtOPFF+d+Wu64dLJn5fNnTZs4JNNA0uqvvvB71n2\nn7/dkqIMG1af5smDxgeK2I9P5Fe8ppbtyaXebdrUp0z0wMFbsQghhFBtPbb5wLCzzZ+JazZm\nxsRubVr5C0rPn/jjvS3Hx7/c+JNfnMSLfdpRbuc7Xx+c0jMq6/LhlTPnAcCV1Ly+EQAAB8c9\ntsKytk9j5dEvli+6WLz45P/q0zZG4LNzRrteAx5r8uGqHlHSvVve+KpYsmNDx/qUiR44mNgh\nhBBCtcUIA7edutprxaJN2zd++U4Oq/Rv33vQD0lnmnLfZmic3D9Vhr7226q0V+cOeb9M0LJ9\n78XfXQ4c2WJJl+bdE98GgD1/LF44ccrSpOKI5m2Wbj83v61fPZvXZfmhjeTFt6YPn6+TtGjT\n6ZPDPz8bIKtnmejBQihtuGVQEEIIIVQLutyP5YHjEnXmJlK8woIaEo6xQwghhBByE5jYIYQQ\nQvceK5FI7ncbkBvCW7EIIYQQQm4Cr9ghhBBCCLkJTOwQQgghhNwEJnYIIYQQQm4CEzuEEEII\nITeBiR1CCCGEkJvAxA4hhBBCyE1gYocQQggh5CYwsUMIIYQQchP/D4dLs8pJS5t5AAAAAElF\nTkSuQmCC"},"metadata":{"image/png":{"height":420,"width":420}},"output_type":"display_data"}],"source":["bike_data %>%\n","  mutate(month = factor(month, levels = month.name)) %>%\n","  mutate(day_of_week = factor(day_of_week, levels = c(\"Sunday\", \"Monday\", \n","    \"Tuesday\", \"Wednesday\", \"Thursday\", \"Friday\", \"Saturday\"))) %>%\n","  group_by(hour_of_day, rideable_type, user_type) %>%\n","  summarise(avg_duration = mean(ride_duration)) %>%\n","  ggplot(aes(x = hour_of_day, y = avg_duration, colour = rideable_type, group = rideable_type)) +\n","  geom_line() +\n","  geom_point() +\n","  scale_x_discrete(guide = guide_axis(check.overlap = TRUE)) +\n","  scale_colour_manual(values = c('classic_bike' = 'darkblue', 'docked_bike' = '#C77CFF', 'electric_bike' = '#d6b200')) +\n","  labs(title = 'Daily Average Ride Distribution per Hour per Bike Type', caption = 'Graph 16', x = 'Hour of Day', y = 'Average Duration(in seconds)', colour = 'Bike Type') +\n","  facet_grid(~user_type)"]},{"cell_type":"markdown","id":"f14e5154","metadata":{"papermill":{"duration":0.04587,"end_time":"2022-08-24T18:50:42.390632","exception":false,"start_time":"2022-08-24T18:50:42.344762","status":"completed"},"tags":[]},"source":["We see some similarities between Graph 16 and Graph 12 above.\n","\n","Graph 16 shows that **casuals are the only ones who use docked bikes.** **Docked bikes are used for extremely long periods of time, particularly at dawn.** \n","\n","Except for the slight increase in average ride duration within the hours of 01:00 to 03:00, classic bikes are almost always ridden constistently every hour.\n","\n","Electric bikes are ridden for approximately the same number of seconds every hour and day."]},{"cell_type":"markdown","id":"f8e43c9a","metadata":{"papermill":{"duration":0.046666,"end_time":"2022-08-24T18:50:42.482851","exception":false,"start_time":"2022-08-24T18:50:42.436185","status":"completed"},"tags":[]},"source":["<a id=\"subsection-twenty-two\"></a>\n","#### Key Findings\n","* Though  members use bikes relatively more than casuals, casuals use bikes significantly. There is only a 12% difference between them. Thus, if annual members currently are much more profitable than casual riders, then converting casual riders into annual members will increase the company's profitability by a significant margin.\n","\n","* Weather temperatures and the number of rides recorded are highly positively correlated, therefore majority of rides, approximately 41% of all rides, take place during Summer. This is also the only time of year when casuals ride their bikes slightly more than members.\n","\n","* Weekday rides make up 68% of all rides, while weekend rides make up only 32%. Weekend rides are dominated by casuals, while weekday rides are dominated by members. Ride volumes are higher for casuals than for members only on weekends.\n","\n","* The most rides are recorded in the late afternoons and early evenings, with the peak occurring at 17:00 p.m. During the week, members use Cylistic bikes about twice as much as casuals, with peak hours in the early mornings and late afternoons to early evenings. On weekends, casuals use Cyclistic bikes slightly more than members, particularly during peak hours (from the hours of 11:00 a.m. to 18:00 p.m.). Every day at 17:00 a.m., casuals sign up for the bike program.\n","\n","* Casuals tend to ride for longer periods of time than members. Casuals ride for 70% of the total average ride duration compared to 30% for members.\n","\n","* Casuals’ ride duration varies from month-to-month; members' are almost constant. There is a fairly even distribution across seasons in terms of overall average ride duration. Overall, there is no strong relationship between monthly average length of rides and monthly number of rides. The relationship between monthly average length of rides and monthly number of rides for casuals is not too strong. Conversely, a stronger relationship between monthly average length of rides and monthly number of rides for members exists.\n","\n","* Members have a consistent average ride duration across all hours and days. Casuals, on the other hand, have exceptionally long average ride lengths at night, particularly at dawn (00:00 a.m. to 04:00 a.m.). Casuals have high peaks of average ride duration, with an extreme peak value on Tuesdays. Weekend average ride duration is fairly consistent.\n","\n","* Classic and electric bikes are the most popular types of bikes among both user groups. Members, on the other hand, prefer to ride classic bikes over casuals. A small proportion of casual riders use docked bikes, while none of the members use docked bikes. Nonetheless, docked bikes are used for extremely long periods of time, particularly at dawn.\n","\n","* Since high average ride duration and docked bikes are highly linked, it implies that the small percentage of casuals who use docked bikes, are those that account for the long average ride hours at dawn.\n","\n"]},{"cell_type":"markdown","id":"5d20a3bf","metadata":{"papermill":{"duration":0.045714,"end_time":"2022-08-24T18:50:42.573825","exception":false,"start_time":"2022-08-24T18:50:42.528111","status":"completed"},"tags":[]},"source":["<a id=\"section-eight\"></a>\n","# Act\n","<a id=\"subsection-twenty-three\"></a>\n","The goal of this phase is to **develop new marketing strategies based on my findings to convert casual riders into annual members.**\n","\n","<a id=\"subsection-twenty-four\"></a>\n","#### Conclusion \n","We can deduce that both user groups use Cyclistic bikes for commuting, recreation, and fitness. Cyclistic bikes could also be used for cycle sport training by a very small percentage of casuals.\n","\n","Members primarily use their bikes to commute to work and return home from work on weekdays, resulting in higher ride volumes and consistency regardless of weather temperatures. This could explain why they have two peak hours on weekdays: between 7:00 a.m. and 8:00 a.m. (when work starts) and 5:00 p.m. - 6:00 p.m. (when work ends). They also ride bikes for recreational purposes, or to keep fit. This could explain why they only have one peak period on weekends: 10:00 a.m. to 6:00 p.m.\n","\n","Casuals ride bikes more for recreation (especially during Summer), or to stay fit, which explains their higher ride volumes on weekends and during peak hours from 11:00 a.m. to 6:00 p.m. They also use bicycles to commute home from work, with peak volumes around 5:00 p.m. on weekdays.\n","\n","The small percentage of casual riders who use docked bikes for extended periods of time may be long distance cyclists in the field of sports. They may be responsible for the extremely long ride lengths at night, particularly at dawn (00:00 a.m. to 04:00 a.m.), primarily on Weekdays.\n","\n","Lastly, some users may fail to properly dock or lock their bikes after their trips have ended, resulting in the abnormally long ride duration records. Some may even fail to return the bikes to their designated end stations.\n","\n","<a id=\"subsection-twenty-five\"></a>\n","#### Recommendations\n","My top three recommendations based on the visualisations and findings are:\n","\n","1. Cyclistic should raise awareness among their subscribers about using Cyclistic bikes as a healthy, eco-friendly mode of transportation. Cyclistic should incorporate vital health statistics of riders, such as ride hours and their associated health benefits, general health information, and so on, into an app feature to encourage users to be more deliberate in their bike use. This will draw more casuals into annual membership.\n","\n","2. Social ride groups should be formed for users who use bikes for recreational and exercise purposes, with discounts or giveaways available on weekends to those on the membership package. Humans are social beings, so riding bikes in groups while having fun and building profitable connections with others is a key incentive to have casual members decide to become annual members.\n","\n","3. Special annual membership promotions should be created during Summer. Social media awareness about special price reduction schemes should be heightened months leading up to and during the Summer to keep the users informed. This will entice casuals to become members.\n","\n","**Bonus Recommendation:**<br>\n","Annual members who consistently use the bike share program and leave reviews should be rewarded with free rides as an incentive to continue subscribing to the program's annual membership. This assists Cyclistic in retaining loyal members and conveys a sense of appreciation and value to loyal annual members.\n","\n","<a id=\"subsection-twenty-six\"></a>\n","#### Further Work\n","* More research is needed to determine why some ride lengths are as short as 0s while others are longer than a day, even 38 days.\n","\n","* It is critical to determine why casuals ride for longer periods of time, particularly at dawn. Additional research should be conducted, and complete data on the start and end stations would be required to help answer this question.\n","\n","* Furthermore, collecting comprehensive geographical data from start and end stations would provide some more information such as the distribution of rides per area.\n","\n","* Data on details such as age and gender should be included in the subscription form in order to determine ride distribution across these attributes, which will inform a more targeted marketing strategy.\n","\n","* More research on casual riders should be conducted via electronic surveys to determine why they prefer to be casuals rather than members. This provides more direct data-driven information."]}],"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":720.452175,"end_time":"2022-08-24T18:50:42.942296","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2022-08-24T18:38:42.490121","version":"2.3.4"}},"nbformat":4,"nbformat_minor":5}